    render(){
        return(
            <div>
                <form>
                    <label>Fname:</label>
                    <input type="text"></input>
                    <br></br>
                    <label>Email:</label>
                    <input type="email"></input>
                    <br></br>
                    <label>password:</label>
                    <input type="password"></input>
                    <br></br>
                    <label>cpassword</label>
                    <input type="cpassword"></input>
                    <br></br>
                    <input type="submit"></input>
                </form>
            </div>

        )
    }
        
 }
